const Nav = function({ user, onLogout }) {
  if(!user.isLoggedIn) {
    return null;
  }

  return (
    <nav>
      <ul class="nav">
        <li class="logout"><a href="#logout" onClick={onLogout}>Logout</a></li>
      </ul>
    </nav>
  );
};

export default Nav;
